import { View } from 'react-native';
import { Screens } from '../types'
import type { Screen } from '../types';
import TopBar from './TopBar';
import TodoList from '../features/todos/TodoList' 
import { NavigationProp } from "@react-navigation/native";

const todos = [
  {
    id: 'a',
    label: "This is the first item",
  },
  {
    id: 'b',
    label: "This is the second item"
  },
  {
    id: 'c',
    label: "This is the third item"
  },
]

interface TodoListScreenProps {
  navigation: NavigationProp<any, any>
}

export const TodoListScreen = ({ navigation }: TodoListScreenProps) => {

  const onItemPress = (id: string) => navigation.navigate(Screens.TodoDetails, { id });

  return (
    <View>
      <TopBar icon="menu" />
      <TodoList items={todos} onItemPress={onItemPress}/>
    </View>
  )
}

const screen: Screen<TodoListScreenProps> = {
  name: Screens.TodoList,
  subTitle: 'Todo List',
  screen: TodoListScreen
}

export default screen;
